import React from "react";
import ReactDOM from "react-dom";
import sum from "./Calc";
import sub from  "./Sub";
import mult from "./Mult";
import div from "./Div";


ReactDOM.render(
    <>
    <ol>
    <h1><li>hey this is your output</li></h1>
    <li>{sum(3,4)}</li>
    <li>{sub(8,3)}</li>
    <li>{mult(8,3)}</li>
    <li>{div(9,3)}</li>
    
     
     </ol>
     


    </>,
    document.getElementById("root"));
